@import url("https://fonts.googleapis.com/css2?family=Baskervville:ital,wght@0,400..700;1,400..700&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap");


body{
    margin: 0;

    .hero-container{
        background-image: linear-gradient(to bottom, rgba(0, 0, 0, 0) 49%, rgba(0, 0, 0, 1) 100%)
        // ,linear-gradient(to top,  rgba(0, 0, 0, 0) 80%, rgba(0, 0, 0, 1) 100%) 
        ,url('/assets/images/CarlaBeauty_signiture.png');
        height: 630px;
        width: 100%;
        background-size: cover;
        margin: 0;
        background-repeat: no-repeat;
        background-position: center;
        display: flex;
        justify-content: center;
        align-items: end;
        color: white;

